app.service('ImagemService', function ($rootScope, $cordovaCamera, $cordovaImagePicker, LoadService, ToastService) {
    var Imagem = function (src, thumb) {
        this.src = src;
        this.thumb = thumb;
    }
	
	var base64Dev = '';

    return {
        camera: function (callback) {
			if(!dev){
				var options = {
					quality: 100,
					destinationType: Camera.DestinationType.DATA_URL,
					sourceType: Camera.PictureSourceType.CAMERA,
					encodingType: Camera.EncodingType.JPEG,
					saveToPhotoAlbum: false,
					correctOrientation: false,
					targetWidth: 300,
					targetHeight: 300,
					allowEdit: true
				}
				
				$cordovaCamera.getPicture(options).then(function (imageData) {
					callback(null, imageData);
				}, function (error) {
					if(error != 'Camera cancelled.'){
						callback(error);
					}else{
						LoadService.hide();
					}
				});
			}else{
				callback(null, base64Dev);
			}
        },
        galeria: function (callback) {
			if(!dev){
				var options = {
					quality: 100,
					destinationType: Camera.DestinationType.DATA_URL,
					sourceType: Camera.PictureSourceType.PHOTOLIBRARY,
					encodingType: Camera.EncodingType.JPEG,
					saveToPhotoAlbum: false,
					correctOrientation: false,
					targetWidth: 300,
					targetHeight: 300,
					allowEdit: true
				}
	
				$cordovaCamera.getPicture(options).then(function (imageData) {
					callback(null, imageData);
				}, function (error) {
					if(error != 'Selection cancelled.'){
						callback(error);
					}else{
						LoadService.hide();
					}
				});
			}else{
				callback(null, base64Dev);
			}
        },
        imagePicker: function (callback) {
            var options = {
                maximumImagesCount: 10,
                width: 300,
                height: 300,
                quality: 90
            }

            $cordovaImagePicker.getPictures(options).then(function (imagens) {
                callback(null, imagens);
            }, function (error) {
                callback(error);
            });
        },
        getThumbnail: function (base64, callback) {
			if(!dev){
				ImageCropResizer.cropResize(function (data) {
					callback(null, data.imageData);
				}, function (error) {
					callback(error);
				}, base64, 100, 100, null);
			}else{
				callback(null, base64);
			}
        },
		carregarImagem: function (src, thumb, time, storageRefSrc, storageRefThumb, callback) {
			$rootScope.stopSync = function(){
				LoadService.hide();

				uploadTaskSrc = null;
				uploadTaskThumb = null;
				storageRefSrc = null;
				storageRefThumb = null;
			}

			LoadService.showButton($rootScope, 'Carregando imagem');			
			
			var callbackError = function(error){
				storageRefSrc.$delete();
				storageRefThumb.$delete();

				LoadService.hide();

				ToastService.erro('Erro ao tentar adicionar imagem, tente novamente.');
			}

			uploadTaskSrc = storageRefSrc.$putString(src, 'base64', { contentType: "image/jpeg" });
			uploadTaskThumb = storageRefThumb.$putString(thumb, 'base64', { contentType: "image/jpeg" });
			
			uploadTaskSrc.$complete(function(snapshotSrc){
				uploadTaskThumb.$complete(function(snapshotThumb){
					var img = {
						time: time,
						src: snapshotSrc.downloadURL,
						thumb: snapshotThumb.downloadURL
					}

					LoadService.hide();
					
					callback(null, img);
				}, callbackError);
			}, callbackError);
		},
		removeFoto: function (storageRefSrc, storageRefThumb, callback) {
			var erro = function(error) {
				ToastService.erro('Erro ao tentar remover imagem, tente novamente.');
			}
			
			storageRefSrc.$delete().then(function() {
				storageRefThumb.$delete().then(function() {
					callback();
				}).catch(erro);
			}).catch(erro);
		}
    }
});